import React, { useEffect } from 'react'
import {useState} from 'react'
import { NavLink } from 'react-router-dom'

function PageSeven(){
    const [events, setEvents] = useState([])

    const getEvents = async () => {
        const API_ENDPOINT = 'https://app.ticketmaster.com/discovery/v2/events?apikey=7elxdku9GGG5k8j0Xm8KWdANDgecHMV0&locale=*&page=98'
        try{
            const response = await fetch(API_ENDPOINT)
            const data = await response.json()

            setEvents(data._embedded.events)
        } catch(err){
            console.error(err)
        }
    }

    useEffect(()=>{
       getEvents()
    },[])

    return(
        <section>
            {events.map((event)=>{
                    return(

                        <div className='event'>
                            <div className='event-image'>
                                <img style={{width: 300, height: 200}} src={event.images[8].url} />
                            </div>
                            <div className='event-name'>
                                <h2><a href={event.url} target="_blank"> {event.name}</a></h2>
                                <h3>Date: {event.dates.start.localDate}</h3>
                                <h3>Location: {event._embedded.venues[0].name}</h3>
                                <button>Buy</button>
                                <hr></hr>
                            </div>
                        </div>

                )

            })}
            <div className='pages'>
                <p className='pg2'><a href='/page2'> 2</a></p>
                <p className='pg3'><a href='/page3'> 3</a></p>
                <p className='pg4'><a href='/page4'> 4</a></p>
                <p className='pg5'><a href='/page5'> 5</a></p>
                <p className='pg6'><a href='/page6'> 6</a></p>
                <NavLink to='/page7' activeStyle={{fontWeight: "bold", color:"green"}}><p>7</p></NavLink>
                <p className='pg2'>8</p>
                <p className='pg3'>9</p>
                <p className='pg3'>{`>>`}</p>


            </div>
        </section>
    )
}

export default PageSeven
